import Layout from '../containers/common/common-layout'
import { Container, Row, Col } from 'reactstrap'

const PortfolioDetail7 = () => {

  const  [user,setUser]=useState({firstName:"",lastName:""})
    useEffect(() => {
    
        setUser(JSON.parse(localStorage.getItem("user")))       
      }, []);

    return(
    <Fragment>
        <Layout pathList={['portfolio details', 'left side image portfolio']} pathTitle="left side image portfolio">
            <section>
                <div className='d-flex'>
                    <div className='isar'>
                    
                        <img alt="" className="img-fluid rounded-circle w-25   " src="../assets/images/portfolio/1.jpg" />
                    
                            
                    </div>










                    <div className='imin'>too</div>

                </div>
            </section>
        </Layout>
    </Fragment>
    )
}

export default PortfolioDetail7;
